var lerpVal = 0.0;

// Play controls.
var playingAnimation = false;
var playDirection = 0.0; // 1 is forward, -1 is backward.

// From https://easings.net/.
function easeOutElastic(x) {
  const c4 = (2 * Math.PI) / 3;

  return x === 0
    ? 0
    : x === 1
    ? 1
    : Math.pow(2, -30 * x) * Math.sin((x * 10 - 0.75) * c4) + 1;
}

// Play the animation forward.
globalThis.playAnimation = () => {
  playDirection = 1.0;
  lerpVal = 0.0;
  playingAnimation = true;
}

// Play the animation in reverse.
globalThis.reverseAnimation = () => {
  playDirection = -1.0;
  lerpVal = 0.0;
  playingAnimation = true;
}

globalThis.onTick = (eventName, dtString) => {
  const speed = 0.25; // Where 1 means do the whole animation over a second, 0.25 means take 4 secounds.

  const dt = JSON.parse(dtString).deltaTimeMS;
  lerpVal += dt * 0.001 * speed;

  if(playingAnimation) {
    // If we are still interpolating...
    if(lerpVal < 1.0)
    {
      var easeOutLerpVal = lerpVal;
      if(playDirection < 0.0) {
        // Invert the lerp value (relative to 1) if we are playing in reverse...
        easeOutLerpVal = 1.0 - lerpVal;
      }

      // Apply the easeout using the lerp value to find the scale.
      var scale = easeOutElastic(easeOutLerpVal);
      ThisEntity.scale = [scale, scale, scale];
    }
    else {
      // Terminate the animation once we have interpolated to 1.0.
      playingAnimation = false;
      // On the final frame, ensure we end at unit scale or zero scale depending on play direction.
      var finalScale = playDirection > 0.0 ? 1.0 : 0.0;
      ThisEntity.scale = [finalScale, finalScale, finalScale];
    }
  }
}

ThisEntity.subscribeToMessage("playAnimation", "playAnimation");
ThisEntity.subscribeToMessage("reverseAnimation", "reverseAnimation");
ThisEntity.subscribeToMessage("entityTick", "onTick");
